//动态规划+字典树(超出时间限制)
class Solution {
    class Node{
        Node[] next;
//        boolean isConnect;
        boolean end;
        public Node(){
            this.next = new Node[26];
//            this.isConnect = false;
            end = false;
        }
        public void insert(String word){
            char[] wordArr = word.toCharArray();
            Node curNode = this;
            for (char c : wordArr){
                if (curNode.next[c - 'a'] == null){
                    curNode.next[c - 'a'] = new Node();
                }
                curNode = curNode.next[c - 'a'];
            }
            curNode.end = true;
        }
        public boolean hasWord(String word, int l, int r){
            char[] wordArr = word.toCharArray();
            Node curNode = this;
            for (int i = l; i <= r; i++){
                if (curNode.next[wordArr[i] - 'a'] != null){
                    curNode = curNode.next[wordArr[i] - 'a'];
                }else{
                    return false;
                }
            }
            return curNode.end;
        }
    }
    Node dictionary;
    private int getCount(String word){
        int m = word.length();
        if (m < 2) return 0;
        int[][] f = new int[m+1][m];

        for (int k = 0; k < m; k++){
            for (int j = k; j < m; j++){
            	if (dictionary.hasWord(word, j-k, j)){
                    f[j - k][j] = 1;
                }
                for (int l = 0; l <= k; l++){
                    if (f[j-k+l+1][j] > 0 && f[j-k][j-k+l] > 0){
                        f[j - k][j] = 2;
                        break;
                    }
                }
            }
        }
        return f[0][m - 1];
    }
    public List<String> findAllConcatenatedWordsInADict(String[] words) {
        int n = words.length;
        this.dictionary = new Node();
        for (String word : words){
            this.dictionary.insert(word);
        }
        List<String> ret = new ArrayList<>();
        for (int i = 0; i < n; i++){
            if (getCount(words[i]) >= 2){
                ret.add(words[i]);
            };
        }
        return ret;
    }
}
//动态规划2
class Solution1 {
    public List<String> findAllConcatenatedWordsInADict(String[] words) {
        Set<String> set = new HashSet<>();
        for(String word : words)
            set.add(word);
        
        List<String> res = new ArrayList<>();
        for(String word : words){
            if(word.equals(""))
                continue;

            set.remove(word);

            if(canBreak(word, set)){
                res.add(word);
            }

            set.add(word);
        }

        return res;
    }

    private boolean canBreak(String word, Set<String> set){
        if(set.size() == 0)
            return false;
        
        int n = word.length();
        boolean[] dp = new boolean[n + 1];
        for(int i = 0; i <= n; i++){
            if(i == 0){
                dp[i] = true;
                continue;
            }

            for(int j = 0; j < i; j++){
                if(!dp[j])
                    continue;
                
                if(set.contains(word.substring(j, i))){
                    dp[i] = true;
                    break;
                }
            }

        }

        return dp[n];
    }
}
class Solution2 {
    class Node{
        Node[] next;
        boolean end;
        public Node(){
            this.next = new Node[26];
            end = false;
        }
        public void insert(String word){
            char[] wordArr = word.toCharArray();
            Node curNode = this;
            for (char c : wordArr){
                if (curNode.next[c - 'a'] == null){
                    curNode.next[c - 'a'] = new Node();
                }
                curNode = curNode.next[c - 'a'];
            }
            curNode.end = true;
        }
        public boolean hasWord(String word, int l, int r){
            char[] wordArr = word.toCharArray();
            Node curNode = this;
            for (int i = l; i <= r; i++){
                if (curNode.next[wordArr[i] - 'a'] != null){
                    curNode = curNode.next[wordArr[i] - 'a'];
                }else{
                    return false;
                }
            }
            return curNode.end;
        }
    }
    Node dictionary;
    private boolean getCount(String word){
        int m = word.length();
        boolean[] f = new boolean[m + 1];
        f[0] = true;
        
        for (int i = 1; i <= m; i++){
        	for (int j = 0; j < i; j++) {
        		if (!f[j]) continue;
        		String cpWord = word.substring(j, i);
        		if (dictionary.hasWord(word, j, i - 1) && !cpWord.equals(word)) {
        			f[i] = true;
        			break;
        		}
        	}
        }
        return f[m];
    }
    public List<String> findAllConcatenatedWordsInADict(String[] words) {
        int n = words.length;
        if (n == 0) return null;
        this.dictionary = new Node();
        for (String word : words){
            this.dictionary.insert(word);
        }
        List<String> ret = new ArrayList<>();
        for (int i = 0; i < n; i++){
        	if(words[i].equals(""))
                continue;
            if (getCount(words[i])){
                ret.add(words[i]);
            };
        }
        return ret;
    }
}
//43ms超快
class Solution3 {
   public List<String> findAllConcatenatedWordsInADict(String[] words) {
        List<String> ans = new ArrayList<>();
        if (words == null || words.length < 3) {
            return ans;
        }
        // 按照长度。给单词排个序.短的排前面
        Arrays.sort(words, (s1, s2) -> s1.length() - s2.length());
        TrieNode trieNode = new TrieNode();
        for (String word : words) {
            char[] str = word.toCharArray();
            if (str.length > 0 && split1(str, 0, trieNode)) {
                ans.add(word);
            } else {
                insert(trieNode, str);
            }
        }
        return ans;
    }

    // 以i结尾的能不能分割
    public static boolean split1(char[] str, int i, TrieNode head) {
        boolean ans = false;
        if (i == str.length) {
            ans = true;
        } else {
            TrieNode cur = head;
            for (int end = i; end < str.length; end++) {
                int path = str[end] - 'a';
                if (cur.nexts[path] == null) {
                    break;
                }
                cur = cur.nexts[path];
                // 当前来到的i之前所有的字符组成的前缀串，在我们的前缀树中有相应的元件。看看i之后的能不能被分割
                if (cur.end && split1(str, end + 1, head)) {
                    ans = true;
                    break;
                }
            }
        }
        return ans;
    }

    public static void insert(TrieNode head, char[] word) {
        int path = 0;
        for (char w : word) {
            path = w - 'a';
            if (head.nexts[path] == null) {
                head.nexts[path] = new TrieNode();
            }
            head = head.nexts[path];
        }
        // 这一个单词结束，结尾字符标号
        head.end = true;
    }

    public static class TrieNode {
        public boolean end;
        public TrieNode[] nexts;

        public TrieNode() {
            end = false;
            nexts = new TrieNode[26];
        }
    }
}
